import logo from './logo.svg';
import ImageCluster from './components/ImageCluster.js';
import StatisticalAnalysis from './components/StatisticalAnalysis.js';
import Home from './components/Home.js';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
  Link
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Toolbar />
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/tool1" element={<ImageCluster />} />
        <Route path="/tool2" element={<StatisticalAnalysis />} />
        {/* Add more tools here */}
      </Routes>
    </Router>
  );
}
export default App

function Toolbar() {
  return (
    <nav>
      <Link to="/">Home</Link>
      <Link to="/tool1">Tool 1</Link>
      <Link to="/tool2">Tool 2</Link>
    </nav>
  );
}
